function getTags(tags, tagsToRemove) {
	if (!tags.length && !tagsToRemove.length) {
		return undefined
	}
	const obj = {}
	if (tags.length) {
		obj.add = tags
	}
	if (tagsToRemove.length) {
		obj.remove = tagsToRemove
	}
	return obj
}

