}

ifemptyall.code:
function ifemptyall(el, value) {
	if (el == null) {
		return value
	}
	if (Array.isArray(el) && el.length === 0) {
		return value
	}
	if (typeof el === 'object' && el.constructor === Object) {
		const obj = {}
		Object.keys(el).forEach(key => {
			if (el[key] != null) {
				obj[key] = el[key]
			}
		})
		if (!Object.keys(obj).length) {
			return value
		}
		return obj
	}
	return el
}

